import React, { useState, ChangeEvent, useRef, useMemo, useEffect } from 'react';
import './App.css';

function App() {
  const [image, setImage] = useState<string | null>(null);
  const [images, setImages] = useState<{ src: string; editedSrc?: string | null }[]>([]);
  const [editedImage, setEditedImage] = useState<string | null>(null);
  const [originalImage, setOriginalImage] = useState<string | null>(null);
  const [imageSize, setImageSize] = useState<{ width: number; height: number } | null>(null);
  const uploadedImageRef = useRef<HTMLImageElement>(null);
  const [customWidth, setCustomWidth] = useState<number | ''>('');
  const [customHeight, setCustomHeight] = useState<number | ''>('');
  const [modalIsOpen, setModalIsOpen] = useState(false);

  useEffect(() => {
    const updateImageSize = () => {
      if (uploadedImageRef.current) {
        const { width, height } = uploadedImageRef.current;
        setImageSize({ width, height });
      }
    };

    updateImageSize();
    window.addEventListener('resize', updateImageSize);

    return () => {
      window.removeEventListener('resize', updateImageSize);
    };
  }, [editedImage, image]);

  const handleImageChange = (e: ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files && e.target.files[0];
    const reader = new FileReader();

    reader.onloadend = () => {
      if (typeof reader.result === 'string') {
        setImage(reader.result);
        setOriginalImage(reader.result);
      }
    };

    if (file) {
      reader.readAsDataURL(file);
    }
  };

  const handleDownloadAllImages = () => {
    images.forEach((img, index) => {
      const downloadLink = document.createElement('a');
      downloadLink.href = img.editedSrc || img.src;
      downloadLink.download = `image_${index}.png`;
      document.body.appendChild(downloadLink);
      downloadLink.click();
      document.body.removeChild(downloadLink);
    });
  };

  const handleCustomResolution = () => {
    setModalIsOpen(true);
  };

  const handleApplyCustomResolution = () => {
    setModalIsOpen(false);
    console.log('Largura:', customWidth);
    console.log('Altura:', customHeight);
  };

  return (
    <div className="container">
      <div className="content">
        {!image && (
          <div className="upload">
            <label htmlFor="imageInput" className="upload-label">
              Clique aqui para adicionar uma imagem
            </label>
            <input type="file" id="imageInput" accept="image/*" onChange={handleImageChange} style={{ display: 'none' }} />
          </div>
        )}
        <div className="image-container">
          {image && (
            <>
              <img
                ref={uploadedImageRef}
                src={editedImage || image}
                alt="Uploaded Image"
                className="uploaded-image"
              />
              {imageSize && (
                <div className="image-size">
                  {imageSize.width} x {imageSize.height}
                </div>
              )}
            </>
          )}
        </div>
        <div className="buttons">
          <button onClick={handleDownloadAllImages} disabled={!image}>Download Todas as Imagens</button>
          <button onClick={handleCustomResolution} disabled={!image}>Personalizar Resolução</button>
        </div>
        {modalIsOpen && (
          <div className="modal">
            <div className="modal-content">
              <h2>Personalizar Resolução</h2>
              <div className="resolution-inputs">
                <input
                  type="number"
                  placeholder="Largura"
                  value={customWidth}
                  onChange={(e) => setCustomWidth(Number(e.target.value))}
                />
                <input
                  type="number"
                  placeholder="Altura"
                  value={customHeight}
                  onChange={(e) => setCustomHeight(Number(e.target.value))}
                />
              </div>
              <button className="apply-button" onClick={handleApplyCustomResolution}>Aplicar</button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
